    "#Active minutes based on the intensity\n",
    "\n",
    "daily_activity %>% \n",
    "  select(VeryActiveMinutes, FairlyActiveMinutes, LightlyActiveMinutes, SedentaryMinutes) %>% \n",
    "  summary()\n",
    "\n",
    "#calories burnt\n",
    "\n",
    "daily_cal %>% \n",
    "  select(Calories) %>% \n",
    "  summary()\n",
    "\n",
    "#sleep\n",
    "\n",
    "daily_sleep %>% \n",
    "  select(TotalMinutesAsleep, TotalTimeInBed) %>% \n",
    "  summary()\n",
    "\n",
    "#Weight\n",
    "\n",
    "weight_log %>% \n",
    "  select(BMI, WeightKg) %>% \n",
    "  summary()\n",
    "\n",
    "#Daily steps taken\n",
    "\n",
    "daily_steps %>% \n",
    "  select(StepTotal) %>% \n",
    "  summary()\n",
    "\n",
    "#Hourly steps taken\n",
    "\n",
    "hour_steps %>% \n",
    "  select(StepTotal) %>%\n",
    "  summary()\n",
    "\n",
    "#Hourly calories burnt\n",
